import { useState} from 'react';
import MainPanel from './Main/MainPanel';
import Letter from './Main/Letter';
import Books from './Main/Books';
import Loans from './Main/Loans';

function Main(){
    
    const [bookTab, switchTab] = useState(
        <Loans />
    )
    return(
        <div id ="main">
            <MainPanel />
            <Books onOpen={list()} />
            <Letter />
        </div>
    )
}

export default Main;
